eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\nconst homePageTranslations = {\n    heroBanner: {\n        title: {\n            text: \"لو قلقانة من شكل جسمك\",\n            hook: \"هنساعدك ترجعى ثقتك \",\n            hook2: \"فى نفسك\"\n        },\n        description: \"إبدأى رحلتك معانا دلوقتى واستمتعي بتغيير عاداتكِ الغذائية ونمط حياتكِ. و هتبدئي تلاحظي فرق واضح في وزنكِ، مقاسات جسمكِ، وصحتكِ.\",\n        actionButtons: {\n            viewPackages: \"عرض الباقات\",\n            contactUs: \"تواصلي معنا\"\n        }\n    },\n    aboutUsHook: \"هل أنتِ جاهزة تعيشي الفرق؟ انضمي لرحلتنا نحو صحة مثالية، بخبرة وإرشاد مميزين.\",\n    aboutUs: {\n        title: \"معلومات عنا\",\n        subtitle: \"اكتشفي الشخصية الملهمة\",\n        subtitle2: \"وراء نجاح\",\n        name: \"د/ شروق على\",\n        description: {\n            1: \"طبيب صيدلي / أخصائي تغذية علاجية / أخصائي تغذية سمنة ونحافة / هيلث كوتش معتمد ICF\",\n            2: \"عضو الفيدرالية العالمية للسمنة والنحافة SCOPE.\",\n            3: \"عضو الجمعية المصرية للتغذية العلاجية والصحية EASHTEN.\",\n            4: \"عضو الجمعية المصرية لصيادلة التغذية ESNP.\",\n            5: \"أخصائية تغذية علاجية معتمدة من جامعة طنطا.\",\n            6: \"هيلث كوتش معتمد من الفيدرالية العالمية للكوتشنج ICF.\"\n        },\n        actionButtons: {\n            viewMore: \"تعرف على المزيد\",\n            contactUs: \"تواصلي معنا\"\n        }\n    },\n    services: {\n        title: \"خدماتنا\",\n        subtitle: \"إيه اللي بنقدمه !\",\n        servicesData: {\n            1: {\n                name: \"مراجعة تحاليلك و حالتك الصحية\",\n                description: \"مراجعة نتائج تحاليلك وتقييم حالتك الصحية لتصميم أفضل خطة تناسبك.\"\n            },\n            2: {\n                name: \"برامج غذائية مخصصة لحالتك و احتياجاتك\",\n                description: \"برامج غذائية مصممة خصيصاً لتلبية احتياجاتك الصحية والفردية.\"\n            },\n            3: {\n                name: \"برامج تدريبية مناسبة لظروفك و أهدافك\",\n                description: \"برامج تدريبية مصممة خصيصاً لتناسب ظروفك الشخصية وأهدافك.\"\n            },\n            4: {\n                name: \"خطة فيتامينات و مكملات غذائية\",\n                description: \"خطة مخصصة للفيتامينات والمكملات الغذائية بما يتناسب مع احتياجاتك الصحية.\"\n            },\n            5: {\n                name: \"متابعة يومية لمستواك و إلتزامك بالأنظمة\",\n                description: \"متابعة يومية لمدى تقدمك و التزامك بالأنظمة.\"\n            },\n            6: {\n                name: \"خدمة عملاء 7/24 لحل أى مشكلة تواجهك\",\n                description: \"خدمة عملاء متاحة على مدار الساعة لحل أي مشكلة تواجهك.\"\n            }\n        }\n    },\n    reviews: {\n        title: \"آراء العملاء\",\n        subtitle: \"إيه رأي الناس\",\n        subtitle2: \"فينا؟\",\n        reviewsData: {\n            1: {\n                name: \"جهاد محمود شحاتة\",\n                review: \".المتابعة مع دكتورة شروق كانت ممتازة، ساعدتني أظبط أكلي وكان في بدائل كتير لحاجات معينة. المتابعة كانت يرمية على النظام اللي بمشي عليه. أنا بحب السكريات شوية، لكن كانت بتدخل لي وصفات تخليني مش محتاجة ألجا للسكريات. خسيت حوالي 10 كيلو خلال 4 شهور، مع العلم إني ما كنتش مهتمة بالرياضة في الأول بسبب الشغل. لو كنت اهتميت بيها، كان الموضوع هيتظبط أكتر. ما حسيتش بأي حرمان خالص، حتى في أيام العيد ما حسيتش إنى عايزة ابوظ الدايت. لو حصل بتشجعني أرجع للنظام ولا كأن حاجة حصلت. فرق المقاسات واضح جدا، في هدوم البيت وهدوم الخروج اللي ما كنتش بحب شكلي فيها، الحمد لله، الأمور ظبطت كتير\"\n            },\n            2: {\n                name: \"سارة حسام\",\n                review: \"حقيقي يا دكتور شكرا جدا جدا لحضرتك. بجد أنا من غير حضرتك مكنتش أقدر أوصل للوزن دا في فترة الرضاعة، وكمان مع حضرتك قدرت أحافظ على الرضاعة الطبيعية رغم إنني كنت متأثرة بسبب حساسية الألبان اللي عند بنتي واضطريت أقطع المنتجات دي. أنا كنت حقيقي دايمًا هبطانة وبدوخ، لكن مع حضرتك اتحسنت، والرضاعة وإدرار اللبن بقى أحسن كتير. وكمان رجعت لجسمي.\"\n            },\n            3: {\n                name: \"منيره العنان\",\n                review: \"أولًا قبل أي حاجة صحتي، بجد النظام فعلاً فرق معايا جدًا في صحتي في كل حاجة. ثانيًا، الارتجاع تقريبًا اختفى لما انتظمت بمواعيد ثابتة للوجبات والمكملات، بجد اختفى وبقيت بنام دلوقتي من غير أي حاجة للحموضة. ثالثًا، فرق في شكلي جدًا، وده خلى نفسيتي أحسن، وبقى عندي ثقة كدا في نفسي وبقيت مبسوطة من شكل جسمي. رابعًا، المتابعة اليومية مع حضرتك خلتني أقدر أنتظم بسهولة على النظام، فبجد شكرًا.\"\n            },\n            4: {\n                name: \"رنا عماد\",\n                review: \"المتابعة كانت مريحة جدًا، والأكل كان متنوع، ودايمًا كان في بديل لأي حاجة. وبجد البلان كانت مرنة لآخر حد، وبقيت بعرف آكل كويس وما حسيتش أبدًا إني مجبرة على الأكل. زدت 10 كيلو واستفدت من كلام الدكتور وتعليماتها بالنسبة للأكل، وعرفتني إيه المناسب ليا وإيه اللي ما ينفعش، وده ساعدني كتير إني أكون صحيًا أحسن.\"\n            },\n            5: {\n                name: \"مروه عاشور\",\n                review: \"أنا ملاحظة إن معدتي هديت الحمد لله، كنت بصحى من النوم ومعدتي تعباني، دلوقتي. جزاكِ اللّٰه كل خير يا دكتور أعراض القولون العصبي، مثل الانتفاخ والحاجات. بنسبة 80% الوجع بتاع الصبح وبتاع اليوم راح، اللهم لك الحمد، دي بردوا اختفت بجد، وده كان السبب إني مش بقدر آكل كتير.\"\n            },\n            6: {\n                name: \"بسمه سمير\",\n                review: \"أولًا، صحتي بجد تحسنت بشكل كبير، والنظام فعلاً فرق معايا في كل حاجة. ثانيًا، الارتجاع تقريبًا اختفى لما انتظمت بمواعيد ثابتة للوجبات والمكملات، وبجد اختفى، وبقيت بنام دلوقتي من غير أي حاجة للحموضة. ثالثًا، فرق في شكلي جدًا، وده خلى نفسيتي أحسن، وبقى عندي ثقة في نفسي وبقيت مبسوطة من شكل جسمي. رابعًا، المتابعة اليومية مع حضرتك خلتني أقدر أنتظم بسهولة على النظام، فبجد شكرًا جدًا.\"\n            },\n            7: {\n                name: \"ريهام سامي\",\n                review: \"أنا عايزة أشكر حضرتك جدًا يا دكتور. أنا كنت 43 كيلو وبقيت 50. أنا بقيت بجوع وباكل كويس من غير أي أدوية فاتحة شهية. في الأول، معدتي ماكنتش حتى بتستحمل الميه، وكنت مابحبش الأكل. دلوقتي جسمي اتحسن كتير عن الأول، وكل اللي بيشفني بيلاحظ دا ويقولي حتى وشّي بقى كويس ومش رفيع.\"\n            },\n            8: {\n                name: \"دينا خالد أحمد\",\n                review: \"د. شروق، مش لاقية كلام يوصف المتابعة معاها بصراحة. أنا خسيت حوالي 4 كيلو في شهر، بس الأربعة كيلو كأنهم 8 والله، لأن الفرق في مقاسات الجسم كبير، وتقريبًا رجعت لوزني اللي متعودة عليه، وهدومي كلها ظبطت أكتر من الأول غير إن صحتي بقت أفضل بكتير بشهادة دكتور الغدة. ولا كنت بدوخ ولا حسيت بضعف، ولا حاسة بشراهة ناحية الأكل. أنا متابعة معاها، ولا حسيت بحرمان، لأن النظام متوازن في كل حاجة، حتى الشوكولاتة والنسكافيه اللي مبقدرش أستغني عنهم. بحب برضو إنها بتركز على حل المشاكل الصحية اللي عند العميل، وده كان سبب اختياري لها أصلا.\"\n            },\n            9: {\n                name: \"إسراء محمد نجاتى\",\n                review: \"المتابعة ممتازة، وهي دكتورة ممتازة ما شاء الله. التحسن في صحتي كويس، واللي لاحظته جامد إن تساقط شعري قل شوية، بشرتي اتحسنت شوية، وشفايفي وردت شوية بردو،\"\n            },\n            10: {\n                name: \"حنين حمدى\",\n                review: \"كنت 48 ووصلت ل55، اللهم بارك في شهر. كنت ملتزمة بنسبة 80% تقريبًا. دكتور شروق ما شاء اللّٰه عليها ممتازة، والفضل يرجع ليها بعد ربنا لمجهودها وتعبها معايا. بجد، عمري ما زدت الزيادة دي في مدة بالشكل دا. النظام كان صحي جدًا، ولو في حاجة في النظام مش حباها، كنت ببلغها، ومكنش في إجبار على أي أكل خالص. بقيت بأكل كتير، يعني الأول. كان ممكن أقعد أكتر من 6 ساعات من غير أكل، دلوقتي لو عدى 3 ساعات ببقى جعانة جدًا مفيش تأثير سلبي عليا أو على صحتي، بل بالعكس، والله حياتي اتغيرت للأحسن، ودائمًا حاسة إن عندي طاقة. الميزة اللي حققتها معاكم السبعة كيلو دول بجد بالنسبة لي حاجة كبيرة، لأنهم فرقوا أوي معايا. حتى توقعاتي عمرها ما كانت أني أوصل لكدا، بس الحمد لله، وشكرًا ليها ألف مرة.\"\n            },\n            11: {\n                name: \"زينب سعيد\",\n                review: \"أنا خسيت مع دكتور شروق 18 كيلو ونصف. قبل المتابعة، كانت عندي مشكلة كبيرة في ضهري، والمشكلة دي اتحلت بنسبة 95% بعد المتابعة. حصل تغيير رهيب في المقاسات، ودلوقتي بلبس اللي أنا عايزاه.\"\n            },\n            12: {\n                name: \"دعاء احمد\",\n                review: \"أنا مريضة مقاومة أنسولين وكبد دهني، وخسيت مع دكتور شروق 14 كيلو ونصف بكل بساطة. قبل المتابعة، كان عندي خمول جدًا، لكن دلوقتي نشاطي زاد وبتحرك بسهولة.\"\n            },\n            13: {\n                name: \"ضحي فوزي\",\n                review: \"والله دكتورة شروق سكرة، إنسانة بمعنى الكلمة، مخلصة لشغلها جدًا، دقيقة بالمتابعة والمواعيد، بجد همها تفيد وبتعمل مجهود واضح. نظام الأكل رائع، أنا زدت مع الدكتورة 6 كيلو ونصف، عمرى ما حلمت فيهم. تعلمت إزاي آكل، ومتى آكل. كنت شخص مش فاهم لجسمي أبدًا، وتعلمت حتى لأولادي إزاي تكون الوجبة متكاملة. كان البرنامج مرن جدًا، مفيش حاجة ملهاش بديل أبدًا. صحتي تحسنت كتير؛ شعري أصبح أقوى، جسمي، بشرتي افتحت، ووشي بقى أحلى. صرت أحس بجوع. أنا تركت المتابعة معها، بس ما تراجعت شهيتي ولا نزلت بالوزن، ولسه مكملة على نصايحها. ويارب يجزيها الخير هي وكل الفريق اللي شغال معها.\"\n            },\n            14: {\n                name: \"نور هان منصور\",\n                review: \"دكتور شروق من الطف الدكاترة اللي تابعت معاهم. فاهمة جدًا شغلها وعارفة بتعمل إيه كويس. كفاية المتابعة اليومية والاهتمام والرد على الأسئلة. ومش هنسي في يوم كنت محبطة، فضلت معايا ومسبتنيش لحد ما فكتني من المود السيئ اللي كنت فيه. ربنا يجازيها كل خير. تخنت حوالي 6 كيلو في شهرين، وده كمان لأني برضع، ودي حاجة مكنتش متوقعة إني أزيد فيها. كنت فقدت الأمل إن وزني يزيد من الأصل، الحمد لله.\"\n            },\n            15: {\n                name: \"الاء حمدي\",\n                review: \"حابّة أشكركم على اهتمامكم واهتمام الدكتور طول ال 6 شهور دول. أنا وصلت لهدفي اللي بقالي سنين بحاول فيه، وحطيت هدف جديد هنوصل له مع بعض بإذن الله. والدكتور كانت مريحة جدًا، والفترة كانت لطيفة، وده أهم إنجاز عملته في 2024\"\n            }\n        }\n    },\n    hook: {\n        title: \"أكتر من 5000 بنت قدرت تغير وزنها ومقاسات جسمها مع د . شروق على\"\n    }\n};\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (homePageTranslations);\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./src/locales/AR/pages/homePageTranslations.js\n");

